alt-trans.target:
-logger | / logger: < Uri/FriendlyName do agente de log >
      Especifica um agente de log para resultados de teste.  Por exemplo, para registrar em log os resultados em um Visual Studio Test resultados arquivo (TRX) usam /logger:trx.
      Para publicar resultados de teste no Team Foundation Server, use TfsPublisher como mostrado abaixo
      Exemplo: /logger:TfsPublisher;
                Coleção = < url de coleção de projeto de equipe >;
                BuildName = < nome da compilação >;
                TeamProject = < nome do projeto de equipe >
                [; Plataforma = < padrão é "Qualquer CPU" >]
                [; Tipo = < padrão é "Debug" >]
                [; RunTitle = < title >]
